    res = 1
    for i in range(2, (int)(math.sqrt(n)) + 1):
        count = 0
        curr_sum = 1
        curr_term = 1
        while n % i == 0:
            count = count + 1
            n = n // i
            if i == 2 and count == 1:
                curr_sum = 0
