def recur_gcd(a, b):
    low = min(a, b)
    high = max(a, b)
    if low == 0:
        return high
    elif low == 1:
        return 1
    else:
        return recur_gcd(low, high % low)

def min_jumps(arr, n):
    jumps = [0 for i in range(n)]
    if (n == 0) or (arr[0] == 0):
        return float("inf")
    jumps[0] = 0
    for i in range(1, n):
        jumps[i] = float("inf")
        for j in range(i):
            if (i <= j + arr[j]) and (jumps[j] != float("inf")):
                jumps[i] = min(jumps[i], jumps[j] + 1)
                break
    return jumps[n - 1]

